import { Injectable } from '@angular/core';
import { EventModel } from '../models/event.model';
import { ClassModel } from '../models/class.model';

@Injectable()
export class LocalStorageService {

  get() {
    const allEvents = JSON.parse(localStorage.getItem('events'));
    if (!allEvents) {
      const savedEvents: EventModel[] = [
        {name:'Event1', date:'12.12.12', duration:'12.12.13', eventImageUrl: 'data:image/jpeg;base64,', classes: [{  name: 'c' }] },
        {name:'Event1', date:'12.12.12', duration:'12.12.13', eventImageUrl: 'data:image/jpeg;base64,', classes: [{  name: 'd' }] },
        {name:'Event1', date:'12.12.12', duration:'12.12.13', eventImageUrl: 'data:image/jpeg;base64,', classes: [{  name: 'a' }] },
        {name:'Event1', date:'12.12.12', duration:'12.12.13', eventImageUrl: 'data:image/jpeg;base64,', classes: [{  name: 'e' }] },
      ];
      localStorage.setItem('events', JSON.stringify(savedEvents));
      return savedEvents;  
    }

    return allEvents;
  }

  getAllClasses() {
    const allClasses = JSON.parse(localStorage.getItem('classes'));
    if (!allClasses) {
      const savedClasses: ClassModel[] = [
        {name:'First Grade'},
        {name:'second Grade'},
        {name:'third Grade'},
      ];
      localStorage.setItem('classes', JSON.stringify(savedClasses));
      return savedClasses;  
    }
    return allClasses;
  }

}
